- proto: Paper
  entities:
  - uid: 573
    components:
    - type: Transform
      pos: 0.18917465,-91.40217
      parent: 1
    - type: Paper
      content: >-
        [head=2][color=darkgreen]2. Обязательные помещения:[/color][/head]


        [bold][color=gold]● Центр управления (капитанский мостик)[/color][/bold]  

        Усиленный командный отсек с креслом, консолями навигации, связи и мониторинга внешней среды.


        [bold][color=maroon]● Личные апартаменты[/color][/bold]  

        Приватные покои с двуспальной кроватью, терминалом, книгами, личным сейфом, системой безопасности и винным минибаром.


        [bold][color=olive]● Комната наблюдения[/color][/bold]  

        Панорамное окно (или экран), карты сектора, радиоконсоль и кресло для стратегического анализа.


        [bold][color=darkred]● Серверная и терминальная комната[/color][/bold]  

        Защищённые узлы с базой данных, ИИ-подключением, инженерным управлением и мониторингом энергии.


        [bold][color=purple]● Лаборатория[/color][/bold]  

        Компактная комната с минимумом оборудования: стол, сканер, комплект базовых реагентов, контейнеры.


        [bold][color=darkgreen]● Кухонный модуль + мини-ресторан[/color][/bold]  

        Компактная кухня, плита, морозильник, биогенератор и 2 места для приёма пищи с мягким освещением.


        [bold][color=gray]● Медицинский отсек[/color][/bold]  

        Криокапсула, аптечки, сканер, хирургический стол (опционально), холодильник с препаратами.


        [bold][color=teal]● Комната охраны[/color][/bold]  

        Бронированные шкафчики, оружейный сейф, консоль видеонаблюдения, тайный выход в шлюзовую.


        [bold][color=deepskyblue]● Гостевой салон[/color][/bold]  

        Диваны, фонарь, мягкий пол, проигрыватель и бар для встреч с союзниками и "деловыми партнёрами".


        [head=2][color=darkgreen]3. Дополнительные зоны:[/color][/head]

        • Маленький гидропонный отсек с 2-4 ячейками  

        • Потайная комната или хранилище под подом  

        • Площадка для одного дрона или истребителя  

        • Солнечные панели + аварийный аккумулятор  


        [head=2][color=darkgreen]4. Эстетика и стиль:[/color][/head]

        • Цветовая палитра: [color=navy]тёмно-синий[/color], [color=gold]золото[/color], [color=gray]сталь[/color]  

        • Полы: ковровое покрытие или глянцевая плитка в личных зонах  

        • Освещение: мягкое, тёплое, с возможностью затемнения  

        • Музыкальный терминал с треками "властной одиночки"
